mapper.select:

select 

from APIDTL
where APIDTL_TX_DATE = #{apidtlTxDate,jdbcType=CHAR}
  and APIDTL_TXN_NO = #{apidtlTxnNo,jdbcType=VARCHAR}
  and APIDTL_TXDATETM = #{apidtlTxdatetm,jdbcType=VARCHAR}

mapper.delete:

delete from APIDTL
where APIDTL_TX_DATE = #{apidtlTxDate,jdbcType=CHAR}
  and APIDTL_TXN_NO = #{apidtlTxnNo,jdbcType=VARCHAR}
  and APIDTL_TXDATETM = #{apidtlTxdatetm,jdbcType=VARCHAR}
